    position: fixed;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    display: none;
    opacity: 0;
    text-align: left;
    -webkit-transform-style: preserve-3d;
    -moz-transform-style: preserve-3d;
    transform-style: preserve-3d;

    h3 {
      font-size: $menuSizeDesktop;
      color: $menuColour;
      padding-bottom: 45px;
      margin: 0;
    }

    ul {
      position: relative;
      top: 50%;
      transform: translateY(-50%);
      list-style: none;
      color: #000;
      padding: 0;
      margin: 0;
      text-align: center;

      li {
        line-height: $menuLH;
        width: auto;

        a {
          position: relative;
          display: inline-block;
          color: $menuColour;
          text-decoration: none;
          line-height: $menuLH;
          font-size: $menuSizeMobile;

          @include media-breakpoint-up(lg) {
            font-size: $menuSizeDesktop;
          }

          font-weight: $menuWeight;
          margin-top: 0;
          font-family: "TheinhardtM", sans-serif;

          &::before {
            content: "";
            width: 50px;
            position: absolute;
            left: -22px;
            bottom: -1px;
            height: 1px;
            background: $menuColour;
            opacity: 0;
            -webkit-transition: all $transition ease-in-out;
            -moz-transition: all $transition ease-in-out;
            -ms-transition: all $transition ease-in-out;
            -o-transition: all $transition ease-in-out;
            transition: all $transition ease-in-out;

            /* @include media-breakpoint-up(md) {
              bottom: 4px;
              height: 2px;
            }

            @include media-breakpoint-up(lg) {
              bottom: 2px;
              height: 2px;
            }

            @include media-breakpoint-up(xl) {
              bottom: 2px;
              height: 2px;
            }

            @include media-breakpoint-up(xxl) {
              bottom: -5px;
              height: 2px;
            } */
          }

          &:hover {
            text-decoration: none;

            &::before {
              opacity: 1;
              animation: blink 0.5s infinite 0.3s;

              @keyframes blink {
                0% {
                  opacity: 1;
                }

                50% {
                  opacity: 0;
                }

                100% {
                  opacity: 1;
                }
              }
            }
          }

          &:focus {
            text-decoration: none;
          }
        }

        &.active {
          a {
            &::before {
              opacity: 1;
              width: 100%;
              left: 0;
            }
          }
        }
      }

      li + li {
        a {
          margin-left: 30%;
          margin-top: calc((100vw / 49) * 4);
        }
      }

      li + li + li {
        a {
          margin-left: -30%;
          margin-top: calc((100vw / 49) * 1);
        }
      }
    }

    .menu-item {
      //display:block;
    }
  }
